import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const SearchPresenter = ({
  movieResults,
  tvResults,
  searchTerm,
  loading,
  error,
}) => null;

SearchPresenter.propTypes = {
  movieResults,
  tvResults,
  searchTerm,
  loading,
  error,
};

export default SearchPresenter;
